import React, { Component } from "react";
import {
    TabContent,
    TabPane,
    Nav,
    NavItem,
    NavLink,
    Card,
    Button,
    CardTitle,
    CardText,
    Row,
    Col, FormGroup, Label, Input
} from "reactstrap";
import classnames from "classnames";

class TabsBorderBottom extends Component {
    state = {
        activeTab: "1"
    };

    toggle = tab => {
        if (this.state.activeTab !== tab) {
            this.setState({
                activeTab: tab
            });
        }
    };
    render() {
        return (
            <div>
                <Nav tabs className="nav-border-bottom">
                    <NavItem>
                        <NavLink
                            className={classnames({
                                active: this.state.activeTab === "1"
                            })}
                            onClick={() => {
                                this.toggle("1");
                            }}
                        >
                            Group
                        </NavLink>
                    </NavItem>
                    <NavItem>
                        <NavLink
                            className={classnames({
                                active: this.state.activeTab === "2"
                            })}
                            onClick={() => {
                                this.toggle("2");
                            }}
                        >
                            Supplier
                        </NavLink>
                    </NavItem>

                    <NavItem>
                        <NavLink
                            className={classnames({
                                active: this.state.activeTab === "3"
                            })}
                            onClick={() => {
                                this.toggle("3");
                            }}
                        >
                            code
                        </NavLink>
                    </NavItem>
                    <NavItem>
                        <NavLink
                            className={classnames({
                                active: this.state.activeTab === "4"
                            })}
                            onClick={() => {
                                this.toggle("4");
                            }}
                        >
                            Nkaragrutyun
                        </NavLink>
                    </NavItem>
                </Nav>
                <TabContent activeTab={this.state.activeTab}>
                    <TabPane tabId="1">
                        <Row>
                            <Col sm="12">
                                <h4>Tab 1 Contents</h4>
                                <p>Lemon drops pastry chocolate. Jujubes sweet roll tootsie roll. Oat cake donut bonbon chocolate croissant candy candy brownie. Wafer jelly beans jelly ice cream caramels. Cookie bonbon lemon drops cheesecake brownie cake macaroon sweet. Toffee pie icing candy ice cream croissant caramels jelly. Muffin jelly gummies icing cheesecake chocolate cake. Sweet chupa chups croissant pudding sesame snaps soufflé. Marzipan cotton candy jujubes halvah cheesecake. Cupcake wafer gummies croissant candy brownie jelly. Sweet wafer chocolate halvah.</p>
                            </Col>
                        </Row>
                    </TabPane>
                    <TabPane tabId="2">
                        <Row>
                            <Col sm="6">
                                <Card body>
                                    <CardTitle>Special Title Treatment</CardTitle>
                                    <CardText>
                                        With supporting text below as a natural lead-in to
                                        additional content.
                                    </CardText>
                                    <Button className="btn btn-success">Go somewhere</Button>
                                </Card>
                            </Col>
                            <Col sm="6">
                                <Card body>
                                    <CardTitle>Special Title Treatment</CardTitle>
                                    <CardText>
                                        With supporting text below as a natural lead-in to
                                        additional content.
                                    </CardText>
                                    <Button className="btn btn-danger">Go somewhere</Button>
                                </Card>
                            </Col>
                        </Row>
                    </TabPane>
                    <TabPane tabId="3">
                        <Row>
                            <Col sm="12">
                                <FormGroup>
                                    <Label for="projectinput2">Բարկոդ</Label>
                                    <Input type="text" id="projectinput2"   name="lname" />
                                </FormGroup>
                            </Col>
                        </Row>
                    </TabPane>
                    <TabPane tabId="4">
                        <Row>
                            <Col sm="12">
                                <FormGroup>
                                    <Label for="projectinput8">Նկարագրություն</Label>
                                    <Input type="textarea" id="projectinput8" rows="5"  name="comment" />
                                </FormGroup>
                            </Col>
                        </Row>
                    </TabPane>
                </TabContent>
            </div>
        );
    }
}

export default TabsBorderBottom;
